import React from 'react'
import  { Box } from '@mui/material'



export const CustomBox = () => {

    return (
        <>
            <Box display='flex' flexGrow='1'>
                <Box display='flex'
                    sx={{
                        backgroundColor: 'primary.main',
                        color: 'white',
                        paddig: '16px',
                        '&:hover': {
                            backgroundColor: 'primary.light'
                        }
                    }}
                >
                    TEST
                </Box>
                <Box display='flex'
                    sx={{
                        backgroundColor: 'primary.main',
                        color: 'white',
                        paddig: '16px',
                        '&:hover': {
                            backgroundColor: 'primary.light'
                        }
                    }}
                >
                    TEST 2
                </Box>
                <Box display='flex'
                    sx={{
                        backgroundColor: 'primary.main',
                        color: 'white',
                        paddig: '16px',
                        '&:hover': {
                            backgroundColor: 'primary.light'
                        }
                    }}
                >
                    TEST 2
                </Box>
            </Box>
        </>
    )
}
